ZE("common/stringbuffer.effekt",'module stringbuffer\n\nimport bytearray\n\ninterface StringBuffer {\n  def write(str: String): Unit\n  def flush(): String\n}\n\ndef stringBuffer[A] { prog: \x3d\x3e A / StringBuffer }: A \x3d {\n  val initialCapacity \x3d 128\n  var buffer \x3d bytearray::allocate(initialCapacity)\n  // next free index to write to\n  var pos \x3d 0\n\n  def ensureCapacity(sizeToAdd: Int): Unit \x3d {\n    val cap \x3d buffer.size - pos\n    if (sizeToAdd \x3c\x3d cap) ()\n    else {\n      // Double the capacity while ensuring the required capacity\n      val newSize \x3d max(buffer.size * 2, buffer.size + sizeToAdd)\n      buffer \x3d buffer.resize(newSize)\n    }\n  }\n\n  try { prog() }\n  with StringBuffer {\n    def write(str) \x3d {\n      val bytes \x3d fromString(str)\n      ensureCapacity(bytes.size)\n      bytes.foreach { b \x3d\x3e\n        buffer.unsafeSet(pos, b)\n        pos \x3d pos + 1\n      }\n      resume(())\n    }\n    def flush() \x3d {\n      // resize (\x26 copy) buffer to strip trailing zeros that otherwise would be converted into 0x00 characters\n      val str \x3d bytearray::resize(buffer, pos).toString()\n      // NOTE: Keep the `buffer` as-is (no wipe, no realloc),\n      //       just reset the `pos` in case we want to use it again.\n      pos \x3d 0\n      resume(str)\n    }\n  }\n}\n\n/// Handler for string interpolation using a string buffer\ndef s { prog: () \x3d\x3e Unit / { literal, splice[String] } }: String \x3d\n  stringBuffer {\n    try { prog(); do flush() }\n    with splice[String] { x \x3d\x3e resume(do write(x)) }\n    with literal { s \x3d\x3e resume(do write(s)) }\n  }\n\nnamespace examples {\n  def main() \x3d {\n    with stringBuffer\n\n    do write("hello")\n    do write(", world")\n    // prints `hello, world`\n    println(do flush())\n\n    // prints the empty string\n    println(do flush())\n\n    do write("Ef")\n    do write("fe")\n    do write("kt")\n    do write(" \x3d ")\n    do write("")\n    do write("Effekt")\n    // prints `Effekt \x3d Effekt`\n    println(do flush())\n  }\n}\n');
ZE("common/regex.effekt",'module regex\n\nimport string\n\nextern include chez "text/pregexp.scm"\n\nextern type Regex\n\nrecord Match(matched: String, index: Int)\n\nextern pure def regex(str: String): Regex \x3d\n  js "new RegExp(${str})"\n  chez "(pregexp ${str})"\n  vm "regex::regex(String)"\n\ndef exec(reg: Regex, str: String): Option[Match] \x3d {\n  val v \x3d internal::exec(reg, str)\n  if (v.isUndefined)\n    None()\n  else\n    Some(Match(internal::matched(v), internal::index(v)))\n}\n\nnamespace internal {\n\n  /// The type RegexMatch is used internally to represent platform\n  /// dependent results of matching a regex.\n  extern type RegexMatch\n    // js: { matched: String, index: Int } | undefined\n    // vm: scala.util.matching.Regex.Match | null\n\n  extern pure def matched(r: RegexMatch): String \x3d\n    js "${r}.matched"\n    chez "(vector-ref ${r} 0)"\n    vm "regex::matched(RegexMatch)"\n\n  extern pure def index(r: RegexMatch): Int \x3d\n    js "${r}.index"\n    chez "(vector-ref ${r} 1)"\n    vm "regex::index(RegexMatch)"\n\n  extern js !!!MULTILINEMARKER!!!\n    function regex$exec(reg, str) {\n      var res \x3d reg.exec(str);\n      if (res \x3d\x3d\x3d null) { return undefined }\n      else { return { matched: res[0], index: res.index } }\n    }\n  !!!MULTILINEMARKER!!!\n\n  extern chez !!!MULTILINEMARKER!!!\n  (define regex-exec\n    (lambda (regex str)\n      (let* ([positions (pregexp-match-positions regex str)]\n        [match (pregexp-match regex str)])\n    (if (and positions match)\n        (vector (car match) (caar positions))\n        #f))))\n  !!!MULTILINEMARKER!!!\n\n  extern io def exec(reg: Regex, str: String): RegexMatch \x3d\n    js "regex$exec(${reg}, ${str})"\n    chez "(regex-exec ${reg} ${str})"\n    vm "regex::exec(Regex, String)"\n}');
ZE("common/dequeue.effekt",'module dequeue\n\n\n/// An implementation of a functional dequeue, using Okasaki\'s\n/// bankers dequeue implementation.\n///\n/// Translation from the Haskell implementation:\n///   https://hackage.haskell.org/package/dequeue-0.1.12/docs/src/Data-Dequeue.html#Dequeue\nrecord Dequeue[R](front: List[R], frontSize: Int, rear: List[R], rearSize: Int)\n\ndef emptyQueue[R](): Dequeue[R] \x3d Dequeue(Nil(), 0, Nil(), 0)\n\ndef isEmpty[R](dq: Dequeue[R]): Bool \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e (fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 0)\n}\n\ndef size[R](dq: Dequeue[R]): Int \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e fs + rs\n}\n\ndef first[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 0) \x26\x26 (rs \x3d\x3d 1)) { r.headOption }\n      else { f.headOption }\n}\n\ndef last[R](dq: Dequeue[R]): Option[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n      if ((fs \x3d\x3d 1) \x26\x26 (rs \x3d\x3d 0)) { f.headOption }\n      else { r.headOption }\n}\n\ndef check[R](dq: Dequeue[R]): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e\n        val c \x3d 4;\n        val size1 \x3d (fs + rs) / 2;\n        val size2 \x3d (fs + rs) - size1;\n\n        if (fs \x3e c * rs + 1) {\n            val front \x3d f.take(size1);\n            val rear \x3d r.append(f.drop(size1).reverse);\n            Dequeue(front, size1, rear, size2)\n        } else if (rs \x3e c * fs + 1) {\n            val front \x3d f.append(r.drop(size1).reverse);\n            val rear \x3d r.take(size1);\n            Dequeue(front, size2, rear, size1)\n        } else {\n            dq\n        }\n}\n\ndef pushFront[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(Cons(el, f), fs + 1, r, rs).check\n}\n\ndef popFront[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Nil(), fs, Cons(x, Nil()), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(Nil(), fs, r, rs) \x3d\x3e\n        None()\n    case Dequeue(Cons(x, rest), fs, r, rs) \x3d\x3e\n        Some((x, Dequeue(rest, fs - 1, r, rs).check))\n}\n\ndef pushBack[R](dq: Dequeue[R], el: R): Dequeue[R] \x3d dq match {\n    case Dequeue(f, fs, r, rs) \x3d\x3e Dequeue(f, fs, Cons(el, r), rs + 1).check\n}\n\ndef popBack[R](dq: Dequeue[R]): Option[(R, Dequeue[R])] \x3d dq match {\n    case Dequeue(Cons(x, Nil()), fs, Nil(), rs) \x3d\x3e\n        Some((x, emptyQueue()))\n    case Dequeue(f, fs, Nil(), rs) \x3d\x3e\n        None()\n    case Dequeue(f, fs, Cons(x, rest), rs) \x3d\x3e\n        Some((x, Dequeue(f, fs, rest, rs - 1).check))\n}\n\n\ndef show[A](d: Dequeue[A]) { showA: A \x3d\x3e String }: String \x3d {\n  val Dequeue(front, frontSize, rear, rearSize) \x3d d;\n  "Dequeue(" ++ show(front){showA} ++ ", " ++ show(frontSize) ++ ", " ++\n      show(rear){showA} ++ ", " ++ show(rearSize) ++ ")"\n}\ndef show(l: Dequeue[Int]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[Double]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[Bool]): String \x3d show(l) { e \x3d\x3e show(e) }\ndef show(l: Dequeue[String]): String \x3d show(l) { e \x3d\x3e e }\n\ndef println(l: Dequeue[Int]): Unit \x3d println(show(l))\ndef println(l: Dequeue[Double]): Unit \x3d println(show(l))\ndef println(l: Dequeue[Bool]): Unit \x3d println(show(l))\ndef println(l: Dequeue[String]): Unit \x3d println(show(l))\n');
ZE("common/option.effekt",'module option\n\nimport effekt\nimport exception\n\ntype Option[A] {\n  None();\n  Some(value: A)\n}\n\ndef isDefined[A](self: Option[A]): Bool \x3d self match {\n  case None()  \x3d\x3e false\n  case Some(v) \x3d\x3e true\n}\n\ndef isEmpty[A](self: Option[A]): Bool \x3d\n  self.isDefined.not\n\ndef orElse[A](self: Option[A]) { that: \x3d\x3e Option[A] }: Option[A] \x3d self match {\n  case None()  \x3d\x3e that()\n  case Some(v) \x3d\x3e Some(v)\n}\n\ndef getOrElse[A](self: Option[A]) { that: \x3d\x3e A }: A \x3d self match {\n  case None() \x3d\x3e that()\n  case Some(v) \x3d\x3e v\n}\n\ndef map[A, B](self: Option[A]) { f: A \x3d\x3e B }: Option[B] \x3d self match {\n  case None()  \x3d\x3e None()\n  case Some(v) \x3d\x3e Some(f(v))\n}\n\ndef foreach[A](self: Option[A]) { f: A \x3d\x3e Unit }: Unit \x3d self match {\n  case None()  \x3d\x3e ()\n  case Some(v) \x3d\x3e f(v)\n}\n\ndef value[A](self: Option[A]): A / Exception[MissingValue] \x3d self match {\n  case None() \x3d\x3e do raise(MissingValue(), "Trying to get the value of an empty option")\n  case Some(v) \x3d\x3e v\n}\n\ndef option[A] { p: \x3d\x3e A / Exception[MissingValue] }: Option[A] \x3d\n  try { Some(p()) }\n  with Exception[MissingValue] { def raise(_, _) \x3d None() }\n\ndef option[A, E](proxy: on[E]) { p: \x3d\x3e A / Exception[E] }: Option[A] \x3d\n  try { Some(p()) }\n  with Exception[E] { def raise(_, _) \x3d None() }\n\n// Interop with FFI\n// ---------------\n// These functions should only be used by libraries that interface with FFI\ndef undefinedToOption[A](value: A): Option[A] \x3d\n  if (value.isUndefined) { None() } else { Some(value) }\n\n\n// Show Instances\n// --------------\n\ndef show[A](o: Option[A]) { showA: A \x3d\x3e String }: String \x3d o match {\n  case None() \x3d\x3e "None()"\n  case Some(v) \x3d\x3e "Some(" ++ showA(v) ++ ")"\n}\ndef show(o: Option[Int]): String \x3d show(o) { e \x3d\x3e show(e) }\ndef show(o: Option[Double]): String \x3d show(o) { e \x3d\x3e show(e) }\ndef show(o: Option[Bool]): String \x3d show(o) { e \x3d\x3e show(e) }\n\ndef println(o: Option[Int]): Unit \x3d println(show(o))\ndef println(o: Option[Double]): Unit \x3d println(show(o))\ndef println(o: Option[Bool]): Unit \x3d println(show(o))\n');
ZE("common/string.effekt",'module string\n\nimport effekt\nimport option\nimport list\nimport exception\nimport result\nimport char\n\n// TODO\n// - [ ] handle unicode codepoints (that can span two indices) correctly\n// - [ ] use string buffers or other buffers to implement repeated concatenation more efficiently (and `join`)\n// - [ ] maybe use native implementations for toInt, repeat, split, indexOf, etc.\n\n/**\n * Strings\n * - JS: Strings are represented as UTF-16 code units where some characters take 2 slots (surrogate pairs)\n * - Chez: Strings are sequences of unicode characters (?)\n * - LLVM: UTF-8 (characters can take from 1-4 bytes).\n */\n\n\n// Operations\n// ----------\n\ndef substring(str: String, from: Int, to: Int): String \x3d {\n  def clamp(lower: Int, x: Int, upper: Int) \x3d max(lower, min(x, upper))\n  val lower \x3d clamp(0, from, to)\n  val upper \x3d clamp(0, to, str.length)\n  str.unsafeSubstring(lower, upper)\n}\n\ndef substring(str: String, from: Int): String \x3d\n  str.substring(from, str.length)\n\n\n/// Checks whether str starts with the given prefix at `from`\ndef isSubstringAt(str: String, prefix: String, from: Int): Bool \x3d {\n  with default[OutOfBounds, Bool] { false };\n\n  val stringLength \x3d str.length\n  val prefixLength \x3d prefix.length\n\n  def done?(index: Int): Bool \x3d index \x3e\x3d prefixLength\n  def matches?(index: Int): Bool \x3d prefix.charAt(index) \x3d\x3d str.charAt(index + from)\n\n  def go(index: Int): Bool \x3d\n    if (index.done?) true\n    else if (index.matches?) go(index + 1) else false\n\n  go(0)\n}\n\ndef startsWith(str: String, prefix: String): Bool \x3d\n  isSubstringAt(str, prefix, 0)\n\ndef endsWith(str: String, suffix: String): Bool \x3d\n  isSubstringAt(str, suffix, str.length - suffix.length)\n\n/// Repeats the given string n-times.\n///\n/// TODO use a more efficient way of appending strings like a buffer\ndef repeat(str: String, n: Int): String \x3d {\n  def go(n: Int, result: String): String \x3d {\n    if (n \x3c\x3d 0) result\n    else go(n - 1, result ++ str)\n  }\n  go(n, "")\n}\n\n/// Left-pad the given string with spaces\ndef padLeft(str: String, n: Int): String \x3d {\n  " ".repeat(n - str.length) ++ str\n}\n\n/// Right-pad the given string with spaces\ndef padRight(str: String, n: Int): String \x3d {\n  str ++ " ".repeat(n - str.length)\n}\n\n// TODO use .split() in JS\ndef split(str: String, sep: String): List[String] \x3d {\n  val strLength \x3d str.length\n  val sepLength \x3d sep.length\n\n  // special case: seperator is empty, just emit individual chars\n  def empty(index: Int, components: List[String]): List[String] \x3d\n    if (index \x3e\x3d strLength) components.reverse\n    else empty(index + 1, Cons(str.substring(index, index + 1), components))\n\n  def go(lastIndex: Int, components: List[String]): List[String] \x3d\n    indexOf(str, sep, lastIndex) match {\n      case None() \x3d\x3e\n        Cons(str.substring(lastIndex, strLength), components).reverse\n      case Some(index) \x3d\x3e\n        go(index + sepLength, Cons(str.substring(lastIndex, index), components))\n    }\n\n  if (sepLength \x3d\x3d 0) empty(0, Nil())\n  else go(0, Nil())\n}\n\ndef join(strings: List[String], sep: String): String \x3d {\n  def go(strings: List[String], result: String): String \x3d strings match {\n    case Nil() \x3d\x3e result\n    case Cons(s, rest) \x3d\x3e go(rest, result ++ sep ++ s)\n  }\n  strings match {\n    case Nil() \x3d\x3e ""\n    case Cons(first, rest) \x3d\x3e go(rest, first)\n  }\n}\n\nextern pure def trim(str: String): String \x3d\n  js "${str}.trim()"\n\n// Parsing\n// -------\ndef toBool(s: String): Bool / Exception[WrongFormat] \x3d s match {\n  case "true"  \x3d\x3e true\n  case "false" \x3d\x3e false\n  case _ \x3d\x3e wrongFormat("Not a boolean value: \'" ++ s ++ "\'")\n}\n\n// TODO optimize (right now this will be horribly slow (compared to the native JS version)\ndef toInt(str: String): Int / Exception[WrongFormat] \x3d {\n  def go(index: Int, acc: Int): Int \x3d {\n    // wrong index means we\'re done parsing\n    with on[OutOfBounds].default { () \x3d\x3e acc };\n\n    val c \x3d str.charAt(index)\n    val d \x3d char::digitValue(c)\n    go(index + 1, 10 * acc + d)\n  }\n\n  with on[OutOfBounds].default {\n    wrongFormat("Empty string is not a valid number")\n  }\n\n  str.charAt(0) match {\n    case \'-\' \x3d\x3e 0 - go(1, 0)\n    case _   \x3d\x3e go(0, 0)\n  }\n}\n\n// TODO optimize (right now this will be horribly slow (compared to the native JS version)\ndef toInt(str: String, base: Int): Int / Exception[WrongFormat] \x3d {\n  if (base \x3e 36 || base \x3c 1) {\n    wrongFormat("Invalid base: " ++ base.show)\n  }\n\n  def go(index: Int, acc: Int): Int \x3d {\n    // wrong index means we\'re done parsing\n    with on[OutOfBounds].default { () \x3d\x3e acc };\n\n    val c \x3d str.charAt(index)\n    val d \x3d char::digitValue(c, base)\n    go(index + 1, base * acc + d)\n  }\n\n  with on[OutOfBounds].default {\n    wrongFormat("Empty string is not a valid number")\n  }\n\n  str.charAt(0) match {\n    case \'-\' \x3d\x3e 0 - go(1, 0)\n    case _   \x3d\x3e go(0, 0)\n  }\n}\n\n/// Native versions of toInt (unused right now)\nextern pure def unsafeToInt(str: String): Int \x3d\n  js "(Number.isNaN(parseInt(${str})) ? undefined : parseInt(${str}))"\n  chez "(string-\x3enumber ${str})"\n\n\n/// Returns the index of the first occurrence of `sub` in `str`\ndef indexOf(str: String, sub: String): Option[Int] \x3d\n  indexOf(str, sub, 0)\n\ndef indexOf(str: String, sub: String, from: Int): Option[Int] \x3d {\n  val len \x3d str.length\n  def go(index: Int): Option[Int] \x3d\n    if (index \x3e\x3d len) None()\n    else if (str.isSubstringAt(sub, index)) Some(index)\n    else go(index + 1)\n\n  go(from)\n}\n\n/// Returns the index of the last occurence of `sub` in `str`\ndef lastIndexOf(str: String, sub: String): Option[Int] \x3d\n  lastIndexOf(str, sub, str.length)\n\ndef lastIndexOf(str: String, sub: String, from: Int): Option[Int] \x3d {\n  def go(index: Int): Option[Int] \x3d\n    if (index \x3c 0) None()\n    else if (str.isSubstringAt(sub, index)) Some(index)\n    else go(index - 1)\n\n  go(from)\n}\n\n// TODO more efficient (native) implementations could be integrated as follows\n\n// extern pure def indexOf(str: String, sub: String): Option[Int] \x3d\n//   //js { nativeIndexOf(str, sub) }\n//   default { indexOf(str, sub, 0) }\n\n// def nativeIndexOf(str: String, sub: String): Option[Int] \x3d {\n//   val index \x3d str.unsafeIndexOf(sub)\n//   if (index \x3c 0) { None() } else { Some(index) }\n// }\n\n// extern pure def unsafeIndexOf(str: String, sub: String): Int \x3d\n//   js "${str}.indexOf(${sub})"\n\ndef charAt(str: String, index: Int): Char / Exception[OutOfBounds] \x3d\n  if (index \x3c 0 || index \x3e\x3d length(str))\n    do raise(OutOfBounds(), "Index out of bounds: " ++ show(index) ++ " in string: \'" ++ str ++ "\'")\n  else\n    unsafeCharAt(str, index)\n\nextern pure def unsafeCharAt(str: String, n: Int): Char \x3d\n  js "${str}.codePointAt(${n})"\n  chez "(char-\x3einteger (string-ref ${str} ${n}))"\n  llvm !!!MULTILINEMARKER!!!\n    %x \x3d call %Int @c_bytearray_character_at(%Pos ${str}, %Int ${n})\n    ret %Int %x\n  !!!MULTILINEMARKER!!!\n  vm "string::unsafeCharAt(String, Int)"\n');
