ZE("common/ref.effekt",'module ref\n\nimport effekt\n\nextern js !!!MULTILINEMARKER!!!\n  function set$impl(ref, value) {\n    ref.value \x3d value;\n    return $effekt.unit;\n  }\n!!!MULTILINEMARKER!!!\n\nextern llvm !!!MULTILINEMARKER!!!\ndefine void @c_ref_erase_field(ptr %0) {\n  %field \x3d load %Pos, ptr %0, align 8\n  tail call void @erasePositive(%Pos %field)\n  ret void\n}\n!!!MULTILINEMARKER!!!\n\n/// Global, mutable references\nextern type Ref[T]\n\n/** We represent references like positive types in LLVM\n *  The tag is 0 and the obj points to memory with the following layout:\n *\n *   +--[ Header ]--------------+------------+\n *   | ReferenceCount  | Eraser | Field      |\n *   +--------------------------+------------+\n */\n\n/// Allocates a new reference, keeping its value _undefined_.\n/// Prefer using `ref` constructor instead to ensure that the value is defined.\nextern global def allocate[T](): Ref[T] \x3d\n  js "{ value: undefined }"\n  chez "(box #f)"\n  llvm !!!MULTILINEMARKER!!!\n    ; sizeof Header + sizeof Pos \x3d 32\n    %ref \x3d tail call noalias ptr @malloc(i64 noundef 32)\n    %refEraser \x3d getelementptr ptr, ptr %ref, i64 1\n    %fieldTag \x3d getelementptr ptr, ptr %ref, i64 2\n    %fieldData_pointer \x3d getelementptr ptr, ptr %ref, i64 3\n\n    store i64 0, ptr %ref, align 8\n    store ptr @c_ref_erase_field, ptr %refEraser, align 8\n    store i64 0, ptr %fieldTag, align 8\n    store ptr null, ptr %fieldData_pointer, align 8 \n\n    %refWrap \x3d insertvalue %Pos { i64 0, ptr poison }, ptr %ref, 1\n    ret %Pos %refWrap\n  !!!MULTILINEMARKER!!!\n\n/// Creates a new reference with the initial value `init`.\nextern global def ref[T](init: T): Ref[T] \x3d\n  js "{ value: ${init} }"\n  chez "(box ${init})"\n  llvm !!!MULTILINEMARKER!!!\n    %initTag \x3d extractvalue %Pos ${init}, 0\n    %initObject_pointer \x3d extractvalue %Pos ${init}, 1\n    ; sizeof Header + sizeof Pos \x3d 32\n    %ref \x3d tail call noalias ptr @malloc(i64 noundef 32)\n    %refEraser \x3d getelementptr ptr, ptr %ref, i64 1\n    %refField \x3d getelementptr ptr, ptr %ref, i64 2\n\n    store i64 0, ptr %ref, align 8\n    store ptr @c_ref_erase_field, ptr %refEraser, align 8\n    store %Pos ${init}, ptr %refField, align 8\n\n    %refWrap \x3d insertvalue %Pos { i64 0, ptr poison }, ptr %ref, 1\n\n    ret %Pos %refWrap\n  !!!MULTILINEMARKER!!!\n  vm "ref::ref[T](T)"\n\n/// Gets the referenced element of the `ref` in constant time.\nextern global def get[T](ref: Ref[T]): T \x3d\n  js "${ref}.value"\n  chez "(unbox ${ref})"\nllvm !!!MULTILINEMARKER!!!\n    %ref_pointer \x3d extractvalue %Pos ${ref}, 1\n    %refField_pointer \x3d getelementptr inbounds ptr, ptr %ref_pointer, i64 2\n    %refField \x3d load %Pos, ptr %refField_pointer, align 8\n\n    tail call void @sharePositive(%Pos %refField)\n    tail call void @erasePositive(%Pos ${ref})\n\n    ret %Pos %refField\n  !!!MULTILINEMARKER!!!\n  vm "ref::get[T](Ref[T])"\n\n/// Sets the referenced element of the `ref` to `value` in constant time.\nextern global def set[T](ref: Ref[T], value: T): Unit \x3d\n  js "set$impl(${ref}, ${value})"\n  chez "(set-box! ${ref} ${value})"\n  llvm !!!MULTILINEMARKER!!!\n    %refField_pointer \x3d extractvalue %Pos ${ref}, 1\n\n    %field_pointer \x3d getelementptr ptr, ptr %refField_pointer, i64 2\n    %field \x3d load %Pos, ptr %field_pointer, align 8\n\n    tail call void @erasePositive(%Pos %field)\n    store %Pos ${value}, ptr %field_pointer\n    tail call void @erasePositive(%Pos ${ref}) \n\n    ret %Pos zeroinitializer\n  !!!MULTILINEMARKER!!!\n  vm "ref::set[T](Ref[T], T)"\n');
